import "./basic.css";
import { useState } from "react";

let BasicJsx = () => {
  const [categories] = useState(["All", "Electronics", "Footwear"]);    
   
  return(
      <div className="container-fluid">
           <ol>
              {
                  categories.map(category=>
                      <li key={category}>{ category }</li>
                      )
              }
           </ol>
      </div>

  )
};
export default BasicJsx;
